import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import NoteState from "./Context/notes/noteState"; // Import NoteState correctly
import "./App.css";
import Navbar from "./Components/Navbar";
import Signup from "./Components/Signup";
import Login from "./Components/Login";
import Footer from "./Components/Footer";
import Home from "./Components/Home";
import Notes from "./Components/Notes";

function App() {
  return (
    <NoteState> {/* Use NoteState with proper capitalization */}
      <Router>
        <div>
          {/* Navbar will be rendered globally as it is outside the routes */}
          <Navbar />
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/signup" element={<Signup />} />
            <Route path="/login" element={<Login />} />
            <Route path="/notes" element={<Notes />} />
          </Routes>
          {/* Footer will be rendered globally */}
          <Footer />
        </div>
      </Router>
    </NoteState>
  );
}

export default App;
